import React, { Component } from 'react';

class Home extends Component {

    myFunction = () => {
        alert("this is a pop-up");
    }

    render() {
        return (
            <div>
                <button onclick={this.myFunction}>Click me here.</button>
            </div>
        );
    }
}

export default Home;
